    [],nt"revision_timestamp": "2016-09-01T12:03:36.301947",nt"name": "chapter-7-trustee-final-reports-summary",nt"isopen":
    false,nt"url": null,nt"notes": "The USTP oversees approximately 1,100 private
    trustees who administer chapter 7 asset and no-asset cases. Chapter 7 trustees are
    responsible for the collection and liquidation of non-exempt assets, and the distribution
    of funds to creditors in accordance with the Bankruptcy Code's distribution scheme.
    When a chapter 7 case with assets is closed, the trustee files a final report that
    accounts for the disposition of assets, as well as the distribution of funds to
    creditors and to administrative expenses. The data from final reports are summarized
    in this table of key variables. Please review the codebook for variable information.",nt"license_title":
